import React from 'react'
import { withOktaAuth } from "@okta/okta-react";


export default withOktaAuth(class CreateUserForm extends React.Component {

    state = {
        firstName: '',
        lastName: '',
        email: '',
        login: '',
        mobilePhone: '',
        groups: [],
    }

    onChangeHandler = (e) => {
        if (e.target.name === "firstName") {
            this.setState({
                firstName: e.target.value
            })
        } else if (e.target.name === "lastName") {
            this.setState({
                lastName: e.target.value
            })
        } else if (e.target.name === "email") {
            this.setState({
                email: e.target.value
            })
        } else if (e.target.name === "login") {
            this.setState({
                login: e.target.value
            })
        } else if (e.target.name === "mobilePhone") {
            this.setState({
                mobilePhone: e.target.value
            })
        }
    }

    onSubmitHandler = (e) => {
        e.preventDefault()
        console.log(this.state)
    }

    render() {
        return(
            <div>
                <h6>Create User</h6>
                <form onSubmit={this.onSubmitHandler}>
                    <input type="text" name="firstName" value={this.state.firstName} onChange={this.onChangeHandler} placeholder="First Name" />
                    <input type="text" name="lastName" value={this.state.lastName} onChange={this.onChangeHandler} placeholder="Last Name" />
                    <input type="text" name="email" value={this.state.email} onChange={this.onChangeHandler} placeholder="Email" />
                    <input type="text" name="login" value={this.state.login} onChange={this.onChangeHandler} placeholder="Login" />
                    <input type="text" name="mobilePhone" value={this.state.mobilePhone} onChange={this.onChangeHandler} placeholder="Phone" />
                    <input type="submit" />

                </form>
            </div>


        )
    }
})
